  false,\n\t\"url\": null,\n\t\"notes\": \"The roads layer contains several classes
  of transportation features including jeep trails, city streets, thoroughfares, unpaved
  roads, state highways, and interstates. Some of the data is 20 years old; therefore,
  care should be taken when using data from areas that have grown in recent years.
  The currency of the State highway system (those for which Caltrans has responsibility)
  is very good, having been updated in 1993. The data can be very dense in highly
  urbanized counties. Los Angeles County has over 200,000 arcs.\",\n\t\"license_title\":
